const initPostState = {
    item: [
        {
            id: 0,
            tags: ['women','hoodie']
        },
        {
            id: 1,
            tags:['men','shirt']
        },
        {
            id: 2,
            tags:['hoodie']
        }

    ]
}

const wardrobeReducer = (state = initPostState, action) => {
    return state;
}

export default wardrobeReducer;
